@César Ixu
De hecho el feminismo que ves en la tele el cual apoya la campaña Me Too no es tan diferente en cuanto mentalidad ya que se empatía con lo que quiere lograr pero, ¿Qué es lo que pasa? Esta al ser una campaña tiene muchos errores en su organización ya que llega a pasar este tipo de errores. Así que las feministas que puedes ver en la televisión pueden empatizar con la campaña o bien apoyar este al 100% pero todas estamos de acuerdo que este es un gran error.
Ah, yo no pertenezco en una organización en sí, si no soy parte de un grupo de feministas de mi Universidad la que antes de presentar una denuncia con el abogado de la escuela solicitamos una carpeta de investigación (ya que sabemos que algunas de estas denuncias pueden ser falsas)
